import React, { Component } from 'react'
import Item from '../Item';
import '../List/index.css';

export default class List extends Component {
    render() {
        const { todos } = this.props;
        console.log({ ...todos[0] });
        return (
            <ul className="todo-main">
                {
                    todos.map((todo) => {
                        return <Item key={todo.id} {...todo} />
                    })
                }
            </ul>
        )
    }
}
